import React from "react";

const Nav = () => {
    return (

        <nav className='Nav'>

            <div><a>Profile</a></div>
            <div><a>Massages</a></div>
            <div><a>News</a></div>
            <div><a>Music</a></div>
            <div><a>Setting</a></div>
        </nav>
    )
}

export default Nav
